import React from "react";
import "./Layout.css";

const Layout = (props) => {
  return (
    <div>
      <nav>
        <div>
          <h1 className="logo">LOGO</h1>
        </div>
        <ul>
          <li>Home</li>
          <li>Your List</li>
        </ul>
      </nav>
      <div className="container">
        <h1>he</h1>
        {props.children}
      </div>
    </div>
  );
};

export default Layout;
